function zq(){var a=xa(),b=(new E(a.content,.01,.01,.99,.1,.4)).a;ka(b);b.b.innerText="Fruit help";a=new E(a.content,.01,.11,.99,1,.3);b=a.a;Va(a);b.innerHTML="Fruits have one or more abilities from a random set.<br/><br/>You can move fruits between the stored and sacrificial slots with the buttons in the fruit dialog. You can choose the active fruit with the arrows. You can only have one active fruit and only the abilities of the active fruit have an effect. You can switch the active fruit at any time.<br/><br/>Fruit essence can be used to level up abilities, increasing their effect. If the fruit has mutliple abilities, click the ability you want to upgrade first.<br/><br/>All fruit essence is available for all fruits, leveling up an ability in one fruit does not consume any fruit essence for other fruits. Example: if you have 50 fruit essence and 3 fruits, then you can use 50 essence in fruit 1, you can also use 50 essence in fruit 2, and you can also use 50 essence in fruit 3, and in any future fruits as well. If you now sacrifice a fruit that gives 10 essence, you have 10 more essence available for all the others.<br/><br/>Leveling up abilities permanently affects this fruit, you cannot undo it. This only matters if this fruit has more than one ability so that you have to choose which ones to level up. And if unhappy with this fruit, you can always wait for a next one and sacrifice this one.<br/><br/>To get more fruit essence, sacrifice fruits by putting them in the sacrificial pool and transcending (available at high enough tree level). The amount of fruit essence of sacrificed fruits depends on their tier (zinc, bronze, ...), the ability levels or how much essence you've used to level them up don't matter for this.<br/><br/>The active and stored fruits do not get sacrificed and stay after transcension.<br/><br/>Higher tier fruits may have more abilities, and abilities provide more boost.<br/><br/>Click the fruit logo in the fruit dialog to mark as favorite and alter color effects (visual effect only).<br/><br/><b>Fusing Fruits</b><br/><br/>Fruits of the same tier (tier bronze and up) can be fused together to allow transfering abilities to create the fruit with the combination you want, when the random drops aren't giving it. Fusing does not increase strength of stats, it's only about allowing control of the combination.<br/><br/>Fusing fruits destroys the two original fruits and creates a new one of same type as first fused fruit and a new set of abilities that depends on the two original ones, but mostly like the first. The rules are as follows:<br/> \u2022 The new fruit will initially have the same abilities as the first original fruit (but all reset to level 1), but some may be pushed out in a next step<br/> \u2022 Any abilities in the second fruit that match the first fruit, will charge up the matching ability: it becomes charged (marked [*]), or fusible (marked [**]) if already charged<br/> \u2022 Any abilities in the second fruit that are fusible [**] will be transfered to the result fruit and push out the last ability of the result fruit<br/> \u2022 Any other abilities of the second fruit disappear and don't matter, the only abilities of the second fruit that matter are: abilities that match the first fruit, to charge them up, and fusible abilities, to replace abilities of the first fruit.<br/> \u2022 The order of abilities of first and second fruit matters, and you can freely reorder abilities in the regular fruit dialog (where you level up abilities), so you can control which abilities of the first fruit stay and which get pushed out.<br/> \u2022 The seasonal abilities of some fruit types (pineapple, ...) do not participiate in fusing. The first fruit determines the type of the resulting fruit, if the second fruit has a seasonal ability, it will be lost.<br/><br/>Summary of the rules: get 3 fruits with ability you want, fuse them together, and fuse the result into a fruit to get that ability in there and push out an unwanted ability. Example: if you desire a silver fruit with flower boost and berry boost, one way you could reach it is:<br/> \u2022 collect 3 silver fruits that have flower boost in any slot, fruits A, B and C<br/> \u2022 fuse A with B, resulting in a fruit AB with charged flower boost, marked [*]<br/> \u2022 fuse AB with C, resulting in a fruit ABC with fusible flower boost, marked [**]<br/> \u2022 collect a fruit D that has berry boost, and if necessary, move berry boost to the first slot <br/> \u2022 fuse ABC into D, resulting in the desired fruit with flower boost and berry boost. Don't forget to level up its abilities, since they'll all be set to level 1.<br/><br/><b>Fruit related hotkeys</b><br/><br/>Note: on mac, ctrl means command instead.<br/> \u2022 <b>ctrl + click fruit</b>: move fruit between sacrificial and storage slots, if possible.<br/> \u2022 <b>shift + click fruit</b>: same as ctrl + click fruit.<br/> \u2022 <b>drag & drop</b>: drag fruits between slots, re-order slots.<br/> \u2022 <b>shift + click fruit ability upgrade</b>: buy multiple abilities up to 25% of currently available essence<br/> \u2022 <b>], } or )</b>: select next active fruit<br/> \u2022 <b>[, { or (</b>: select previous active fruit"}
