Uq(28,"Automaton & Blueprints","You unlocked the automaton!","You unlocked the automaton! You can place the automaton in the ethereal field. When placed, the automaton tab and blueprints unlock, allowing to automate various parts of the game.<br><br>You must place the automaton in the ethereal field before this works, go to its tab, and configure its settings before it actually automates anything.<br><br>More and more automation features become available later in the game.<br><br>When removing the automaton from the ethereal field, all automation features will be disabled, but they all come back the way they were when placing the automaton again.<br><br>Templates can be placed in the field using the regular planting menu. Blueprints can be created and placed from the blueprint button in the tree.",Mc[4],
void 0,[[void 0,Vc[4],void 0],[Vc[4],Rc[4],Vc[4]],[void 0,Vc[4],void 0]]);Uq(29,"Auto upgrades","You unlocked auto upgrades!","You unlocked auto-upgrades for the automaton! See the automaton tab. You can enable or disable auto-upgrades, and choose a max cost the automaton is allowed to spend. All basic upgrades that boost crops, will be automatically performed by the automaton, at their normal cost, when enabled.",Mc[4]);
Uq(30,"Auto upgrades more options","You unlocked more auto upgrade options!","You unlocked more finetuning options for the auto upgrades. See the automaton tab. The controls have changed: you can now configure the max cost per crop type (berry, mushroom, flower, ...).",Mc[4]);
Uq(31,"Auto plant","You unlocked auto plant!","You unlocked auto-planting for the automaton! See the automaton tab. You can enable or disable auto-plant, and choose a max cost the automaton is allowed to spend.<br><br>How this works: the automaton will upgrade existing crops or blueprint templates to a higher tier, if that higher tier is unlocked. The automaton will not plant new crops from scratch, and will only upgrade crops or blueprint templates to the same type, e.g. berry to berry, flower to flower, ...<br><br>For example: If you have a blackberry, and now unlock blueberry, the automaton will automatically upgrade all planted blackberries in the field to blueberries, given enough resources.",Mc[4]);
Uq(32,"Auto plant more options","You unlocked auto plant more options!","You unlocked more finetuning options for auto planting, you can now choose how many resources the automaton can spend on crops of each type.",Mc[4]);
Uq(33,"Auto unlock","You unlocked auto-unlock!","You unlocked auto-unlock. This will unlock the next tiers of crops automatically. Combined with auto-plant and blueprint templates, this can almost fully automate a run.<br><br>Once you planted the general shape of your field with cheap crops or blueprint templates, everything will happen automatically from then on. Just place berries, mushrooms, flowers, nettles and beehives once to indicate the layout.<br><br>Tip: ensure there are some berries that don't touch a mushroom, because if a mushroom consumes all seeds of a berry, income will stop and the automaton won't get resources for further upgrades and planting, resulting in a deadlock.",Mc[4]);
function Vq(){var a=xa(),b=(new E(a.content,.01,.01,.99,.1,.4)).a;ka(b);b.b.innerText="Help";a=new E(a.content,.01,.11,.99,1,.3);b=a.a;Va(a);b.innerHTML='<b>List of keyboard shortcuts:</b><br/><br/>Note: on mac, ctrl means command instead.<br/><br/> \u2022 <b>"1" , "2" , "3"</b>: activate one of the weather abilities.<br/> \u2022 <b>"w"</b>: replant watercress on all field tiles that have a watercress remainder, and refresh existing ones. Such a remainder appears for watercress that have been copying from multiple plants, that is, a good copying spot. Copying has diminishing returns if there are multiple watercress anywhere on the map, 1 or 2 is effective (check the seeds/s income to view the effect).<br/> \u2022 <b>"t"</b>: show transcend dialog (if available)<br/> \u2022 <b>"p"</b>: pick or plant crop under mouse cursor (no mouse click required)<br/> \u2022 <b>"d"</b>: delete crop under mouse cursor (no mouse click required, only if this is enabled in preferences)<br/> \u2022 <b>"u"</b>: upgrade crop or template under mouse cursor (no mouse click required)<br/> \u2022 <b>shift + click empty field</b>: plant last planted or unlocked crop type.<br/> \u2022 <b>ctrl + click empty field</b>: plant a watercress (does not affect last planted type for shift key).<br/> \u2022 <b>ctrl + click non-empty field</b>: delete crop, only if this is enabled in preferences.<br/> \u2022 <b>shift + click non-empty field</b>: replace crop, only if this is enabled in preferences.<br/> \u2022 <b>ctrl + shift + click field</b>: upgrade crop or template to highest unlocked level (if enabled in preferences), pick this crop type as last planted, and on empty field, plant highest of picked crop type you can afford.<br/> \u2022 <b>shift + click upgrade</b>: buy as many of this upgrade as you can afford.<br/> \u2022 <b>shift + click undo</b>: save the undo state now, rather than load it. This overwrites your undo so eliminates any chance of undoing now. This will also be overwritten again if you do actions a minute later.<br/> \u2022 <b>shift + click save import dialog</b>: import and old savegame, but do not run the time, so you get the resources at the time of saving rather than with all production during that time added.<br/> \u2022 <b>ctrl + click fruit</b>: move fruit between sacrificial and storage slots, if possible.<br/> \u2022 <b>shift + click fruit</b>: same as ctrl + click fruit.<br/> \u2022 <b>shift + click fruit ability upgrade</b>: buy multiple abilities up to 25% of currently available essence.<br/> \u2022 <b>], } or )</b>: select next active fruit<br/> \u2022 <b>[, { or (</b>: select previous active fruit<br/> \u2022 <b>esc</b>: close dialog.<br/> \u2022 <b>"b"</b>: open the blueprint library, when available.<br/> \u2022 <b>shift + click blueprint</b>: immediately plant this blueprint, rather than opening its edit screen.<br/><br/><br/>'}
